import React from 'react';
import { Link } from 'react-router-dom';

import '../css/header.css';

import img from '../img/iconSample.jpg';

class Header extends React.Component {

  renderHeader(userData) {
    if(!userData) {
      return (
        <header>
            <Link to={`/timeLine`}>タイムライン</Link>
            <Link to={`/pastTimeLine`}>過去タイムライン</Link>
            <Link to={`/ranking`}>ランキング</Link>
            <Link to={`/userHistory/${userData.id}`}>依頼・投稿履歴</Link>

            <Link to={`/myPage`}><img src={userData.u_icon} alt={`User Icon : ${userData.u_name}`} />マイページ</Link>
        </header>
      )
    } else return <div></div>
  }


  render() {
    //ログインユーザ情報取得
    const headerState = JSON.parse(localStorage.getItem('userData'))
    return(
      <div>{this.renderHeader(headerState)}
      {console.log(headerState)}
    </div>
      );
    }
  }


  export default Header;
